import styled from 'styled-components';
import Bubble from '../../../../bubble/Bubble';

const MainDiv = styled.div
`
    background: white;
    min-height: 300px;
`;

const Welcome = () => {
    return(
        <MainDiv>
            <Bubble src="" />
        </MainDiv>
    )
}

export default Welcome;
